// src/components/LoginModal.tsx
import React, { useState } from 'react';
import styled from 'styled-components';
import axios from 'axios';
import jwtDecode from 'jwt-decode'; 
import RegisterModal from './RegisterModal';
import { useAuthStore } from '../store/authStore';

const ModalContainer = styled.div`
  position: fixed;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  background-color: #121212;
  padding: 20px;
  border-radius: 8px;
  box-shadow: 0 4px 10px rgba(0, 0, 0, 0.3);
  width: 300px; /* Diminuindo a largura */
  height: 500px; /* Aumentando a altura */
  border: 1px solid #444; /* Adicionando borda cinza */
  z-index: 1000;
`;

const ModalHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const ModalTitle = styled.h2`
  color: #fff;
  margin-bottom: 5px;
`;

const ModalSubtitle = styled.p`
  color: #ccc;
  font-size: 14px;
  margin-bottom: 20px;
`;

const CloseButton = styled.button`
  background: none;
  border: none;
  color: #fff;
  cursor: pointer;
`;

const InputGroup = styled.div`
  margin-bottom: 20px;
`;

const Label = styled.label`
  display: block;
  color: #fff;
  margin-bottom: 5px;
`;

const Input = styled.input`
  width: 90%; /* Diminuindo a largura */
  padding: 8px; /* Diminuindo o padding */
  border-radius: 4px;
  border: 1px solid #444;
  background-color: #333;
  color: #fff;
  margin: 0 auto;
  display: block;
  text-align: center; /* Centralizando o texto */
`;

const ActionButton = styled.button`
  width: 100%;
  padding: 10px;
  border: none;
  border-radius: 4px;
  background-color: #5CB85C;
  color: #fff;
  cursor: pointer;
`;

const Link = styled.a`
  color: #5CB85C;
  cursor: pointer;
  display: block;
  margin-top: 10px;
  text-align: center;
`;

const LoginModal: React.FC<{ onClose: () => void }> = ({ onClose }) => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [showRegister, setShowRegister] = useState(false);
  const setAuthenticated = useAuthStore((state) => state.setAuthenticated);
  const setUserId = useAuthStore((state) => state.setUserId);

  const handleLogin = async () => {
    try {
      const response = await axios.post('http://localhost:5002/api/login', { email, password });
      const { token } = response.data;
      
      if (token) {
        localStorage.setItem('token', token);
        
        const decodedToken = jwtDecode<{ id: number }>(token);
        const userId = decodedToken.id;

        console.log('userID depois do login:', userId);
        setAuthenticated(true);
        setUserId(userId);
        onClose();
      }
    } catch (error) {
      alert('Erro ao fazer login.');
    }
  };

  const handleRegisterSuccess = () => {
    setShowRegister(false);
    onClose(); 
    setTimeout(() => {
      setShowRegister(true);
    }, 100);
  };

  return (
    <ModalContainer>
      <ModalHeader>
        <ModalTitle>{showRegister ? 'Crie sua conta' : 'Acesse sua conta'}</ModalTitle>
        <CloseButton onClick={onClose}>X</CloseButton>
      </ModalHeader>
      {!showRegister ? (
        <>
          <ModalSubtitle>Bem vindo de volta! Entre com seus dados</ModalSubtitle>
          <InputGroup>
            <Label>E-mail:</Label>
            <Input 
              placeholder="Digite seu e-mail aqui" 
              value={email} 
              onChange={(e) => setEmail(e.target.value)} 
            />
          </InputGroup>
          <InputGroup>
            <Label>Senha:</Label>
            <Input 
              type="password" 
              placeholder="Digite sua senha aqui"
              value={password} 
              onChange={(e) => setPassword(e.target.value)} 
            />
          </InputGroup>
          <ActionButton onClick={handleLogin}>Fazer login</ActionButton>
          <Link onClick={() => setShowRegister(true)}>Ainda nÃ£o Ã© cadastrado? Crie sua conta.</Link>
        </>
      ) : (
        <RegisterModal onClose={() => setShowRegister(false)} onRegisterSuccess={handleRegisterSuccess} />
      )}
    </ModalContainer>
  );
};

export default LoginModal;
